import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import { NavBar } from '../components'

function App() {
    return (
        <Router>
            <NavBar />
            return (
            <React.Fragment>
                <Container component="main" maxWidth="xs">
                    <Typography variant="h6" gutterBottom>
                        Registration
                    </Typography>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField required id="MovieName" label="Movie Name"  autoComplete="cc-name" value={name}
                            onChange={this.handleChangeInputName}/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                            required
                            id="Rating"
                            label="Rating"
                            autoComplete="cc-number"
                            value={rating}
                            onChange={this.handleChangeInputRating}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField required id="Time" label="Time"  autoComplete="cc-exp" 
                            value={time}
                            onChange={this.handleChangeInputTime}/>
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Button variant="outlined" color="primary" onClick={this.handleIncludeMovie}>Save</Button>&nbsp;&nbsp;
                            <Button variant="outlined" color="primary" href={'/movies/list'}>Cancel</Button>
                        </Grid>
                    </Grid>
                    </Container>
        </React.Fragment>
        );
        </Router>
    );
}

export default App;
